INSERT INTO `v1_7bcce2e7d420f9f208102100eb536916e62bff4a57f4931571ae23d1a6725d96` VALUES ("", 15, 35, 0, 0, 0, 1, "", 2, 30000, 24001);
INSERT INTO `v1_7bcce2e7d420f9f208102100eb536916e62bff4a57f4931571ae23d1a6725d96` VALUES ("", 1, 36, 0, 0, 0, 100, "", 8, 40000, 91002);
INSERT INTO `v1_7bcce2e7d420f9f208102100eb536916e62bff4a57f4931571ae23d1a6725d96` VALUES ("ぺコリーヌ", 1, 37, 0, 107501, 1, 150, "今日は記念日、お祝いですね！\n焼肉、お寿司、ピザ、ケーキ～☆\nあなたとパーティできるなんて、\n幸せです～♪", 8, 40001, 91002);
INSERT INTO `v1_7bcce2e7d420f9f208102100eb536916e62bff4a57f4931571ae23d1a6725d96` VALUES ("コッコロ", 2, 38, 0, 107601, 1, 150, "この記念日を迎えられたのは、\n主さまの器量の賜物\nさすがは主さまでございます\nえらい、えらい♪", 8, 40001, 91002);
INSERT INTO `v1_7bcce2e7d420f9f208102100eb536916e62bff4a57f4931571ae23d1a6725d96` VALUES ("キャル", 3, 39, 0, 107801, 1, 150, "あんたもけっこうやるじゃない！\nちょっとは…割と…け、けっこう\n見直しちゃったわ\n褒めてあげる♪", 8, 40001, 91002);
INSERT INTO `v1_7bcce2e7d420f9f208102100eb536916e62bff4a57f4931571ae23d1a6725d96` VALUES ("スズメ", 4, 40, 0, 107701, 1, 150, "あなたと私にとって、\n今日は特別な日\nあなたの支えがあるから、\n私は頑張れるんです！", 8, 40001, 91002);
INSERT INTO `v1_7bcce2e7d420f9f208102100eb536916e62bff4a57f4931571ae23d1a6725d96` VALUES ("タマキ", 5, 41, 0, 107901, 1, 150, "今日はキミにとっての\n特別な記念日だにゃ\nキミの活躍にはいつも\n猫ながら感謝してるにゃ～♪", 8, 40001, 91002);
INSERT INTO `v1_7bcce2e7d420f9f208102100eb536916e62bff4a57f4931571ae23d1a6725d96` VALUES ("ぺコリーヌ", 6, 42, 0, 107501, 2, 150, "う～かき氷食べ過ぎて、\n身体が冷えちゃいました…\nあなたの体温で温めてください！\nギューーッ♪", 8, 40001, 91002);
INSERT INTO `v1_7bcce2e7d420f9f208102100eb536916e62bff4a57f4931571ae23d1a6725d96` VALUES ("コッコロ", 7, 43, 0, 107601, 2, 150, "夏は危険がいっぱいと申します…\nですが、わたくしが主さまを\nしっかりとお守りいたしますよ", 8, 40001, 91002);
INSERT INTO `v1_7bcce2e7d420f9f208102100eb536916e62bff4a57f4931571ae23d1a6725d96` VALUES ("キャル", 8, 44, 0, 107801, 2, 150, "ん～なんであんたと、ひと夏を\n過ごすことになったのかな…\n結構楽しいからいいけど！\nさ、まだまだ遊ぶわよ！", 8, 40001, 91002);
INSERT INTO `v1_7bcce2e7d420f9f208102100eb536916e62bff4a57f4931571ae23d1a6725d96` VALUES ("スズメ", 9, 45, 0, 107701, 2, 150, "あなたと過ごすはじめての夏…\nいまからドキドキが止まりません\n楽しくて素敵な思い出が、\nまた一つ増えるんですね♪", 8, 40001, 91002);
INSERT INTO `v1_7bcce2e7d420f9f208102100eb536916e62bff4a57f4931571ae23d1a6725d96` VALUES ("タマキ", 10, 46, 0, 107901, 2, 150, "夏は一番の稼ぎ時にゃのに、\n今年はキミと過ごしたいって\n思ってるにゃ楽しい思い出\n増やしてくれるかにゃ？", 8, 40001, 91002);
