INSERT INTO `v1_7bcce2e7d420f9f208102100eb536916e62bff4a57f4931571ae23d1a6725d96` VALUES ("リリ", 4, 324, 0, 125801, 2, 1, "あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", 2, 40011, 24001);
INSERT INTO `v1_7bcce2e7d420f9f208102100eb536916e62bff4a57f4931571ae23d1a6725d96` VALUES ("クリア", 5, 325, 0, 126001, 2, 1, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 2, 40011, 24001);
INSERT INTO `v1_7bcce2e7d420f9f208102100eb536916e62bff4a57f4931571ae23d1a6725d96` VALUES ("プレシア", 6, 326, 0, 126101, 2, 1, "お兄。\nきてくれて、うれしい", 2, 40011, 24001);
